var ShapeType = {
  TRIANGLE: 'triangle',
  STAR: 'star',
  ARROW_4: 'arrow4points',
  ARROW_6: 'arrow6points'
};
var Constants = {
  ShapeType: ShapeType
};

export { ShapeType, Constants as default };
